import React from "react";

const Navbar = () => {
    return (
        <header>
            {/* Navbar principal */}
            <nav
                className="navbar"
                style={{
                    backgroundColor: "#FF4500", // Substitua pelo código exato da cor extraída da imagem
                    color: "white",
                }}
            >
                <div className="container-fluid d-flex justify-content-center">
                    <span
                        className="navbar-brand mb-0 h1"
                        style={{
                            color: "purple", // Cor roxa para o título
                            fontWeight: "bold",
                            fontSize: "24px",
                        }}
                    >
                        LEVE SAÚDE
                    </span>
                </div>
            </nav>
            {/* Subtítulo */}
            <div
                className="text-center py-2"
                style={{
                    backgroundColor: "#FF6347", // Um tom complementar ao laranja
                    color: "#333",
                    fontSize: "16px",
                    fontWeight: "500",
                }}
            >
                Controle de Ativos Infraestrutura
            </div>
        </header>
    );
};

export default Navbar;
